import React from "react";

const CoinGeckoTile = ({ data }) => {
  return (
    <div className="m-4 p-4 bg-white rounded shadow-lg">
      <h3>{data.name}</h3>
      {data.floor_price && data.floor_price.usd && (
        <p>Floor Price (USD): {data.floor_price.usd}</p>
      )}
      {data.floor_price && data.floor_price.native_currency && (
        <p>Floor Price (ETH): {data.floor_price.native_currency}</p>
      )}
      {data.contract_address && (
        <p>Contract Address: {data.contract_address}</p>
      )}
      {data.number_of_unique_addresses && (
        <p>Number of Unique Addresses: {data.number_of_unique_addresses}</p>
      )}
      {data.image && data.image.small && (
        <img src={data.image.small} alt={data.name} />
      )}
      {data.floor_price_1y_percentage_change &&
        data.floor_price_1y_percentage_change.usd && (
          <p>
            Floor Price Change (1 Year, USD):{" "}
            {data.floor_price_1y_percentage_change.usd}
          </p>
        )}
      {data.floor_price_30d_percentage_change &&
        data.floor_price_30d_percentage_change.usd && (
          <p>
            Floor Price Change (30 Days, USD):{" "}
            {data.floor_price_30d_percentage_change.usd}
          </p>
        )}
      {data.floor_price_7d_percentage_change &&
        data.floor_price_7d_percentage_change.usd && (
          <p>
            Floor Price Change (7 Days, USD):{" "}
            {data.floor_price_7d_percentage_change.usd}
          </p>
        )}
      {data.floor_price_24h_percentage_change &&
        data.floor_price_24h_percentage_change.usd && (
          <p>
            Floor Price Change (24 Hours, USD):{" "}
            {data.floor_price_24h_percentage_change.usd}
          </p>
        )}
    </div>
  );
};

export default CoinGeckoTile;
